import React from 'react';
import { Table, Space, Button } from 'antd';
import { Link } from 'react-router-dom';
const CourseList = () => {
	const type = 'teacher';
	const data = [
		{
			kurs: 'cloud computing',
		},
		{
			kurs: 'bulut bilişim',
		},
	];
	const columns = [
		{
			title: 'Course',
			dataIndex: 'kurs',
		},
		{
			title: 'Actions',
			render: () => {
				<Button>hello</Button>;
			},
		},
	];
	return <Table dataSource={data} columns={columns} />;
};
export default CourseList;
